import React from "react";
import Sidebar from "../../components/SidebarLearning";

export default function LearningHome() {
  return (
    <div>
      <Sidebar />
      <div className=" flex flex-row gap-5 text-start p-2 mt-7 ml-[275px]">
        <div className="flex flex-col text-white btn-login rounded-3xl py-4 h-[125px] w-[750px]">
          <h1 className="font-bold text-3xl">Level 1</h1>
          <h2 className="font-bold text-2xl">Basic Phrases</h2>
        </div>
        Test
      </div>
    </div>
  );
}
